import React,{useState} from 'react'


const Login = () =>{

    return(
        <div>
            <form>
                <p>Username:</p>
                <input type="text"></input>

                <p>Password</p>
                <input type="text"></input>

                <button type="button">LOGIN</button>
            </form>
        </div>
    )
}
export default Login;
